import React from "react";
import Cards from "./cards";

const CardsList = ({ results }) => {
  return (
    <div className="style">
      <div className="row" style={{ justifyContent: "space-evenly" }}>
        {results.map((result) => (
          <Cards id={result.id} />
        ))}
      </div>
    </div>
  );
};
export default CardsList;
